$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_5b7417c1bd6f4e8a1181f2e7295a3e28'] = 'Detta alternativ låter dig tilldela gruppen som standardkundgrupp. Standardkundgruppen kommer att konfigureras med avseende på den senaste adressen som lagts till av kunden.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_ab2004936572b7bcf164741f383f4c97'] = 'Ändra standardgrupp med adress';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_307181015f28b24b5cf56a56f268fefc'] = 'Det här alternativet låter dig ändra kundstandardgruppen som är kopplad till landet i det här avsnittet när kunden väljer en standardadress eller under köpprocessen. Om den valda adressen inte har ett giltigt VAT-nummer kommer systemet att ändras till Prestashop kundstandardgrupp';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_f008d6b21c614caada820eac4e9ae732'] = 'Ta bort kund från en annan grupp';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_48cade9acdfa67cc5014f8e885463462'] = 'Det här alternativet tar bort klienten från grupperna där den tidigare tilldelats och lämnar den endast tilldelad till gruppen som är konfigurerad efter land i det här avsnittet. Standardgruppen kommer att ändras till den aktuella gruppen som tilldelats.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_1ccca8b7e16706b70eb3862d8cac1cf3'] = 'Aktiveringsinställningar';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_8d87f75f1db23a3a683f9d9cb870062c'] = 'De korrekta länderna för validering väljs som standard utom standardlandet för butiken, på grund av det faktum att, enligt regleringen av verksamhet inom gemenskapen, måste valideringen av momsnummer utföras för kunder som är bosatta utanför det land där butiken är belägen och tillhör också Europeiska unionen. Om du ändå vill validera momsnumren för kunder som bor i det land där butiken ligger, måste du lägga till det i listan över länder för validering. I en normal situation är det alternativet fördefinierat och bör inte ändras. Ta i beaktande att North of Ireland ingår för verksamhet inom gemenskapen och tillhör Storbritannien (England). Om du har aktiverat VOEC-operationer kommer Norges land att väljas i det här alternativet.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_1a7c23373b408af50cb839fbe7d52c85'] = 'Back-office validering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_882cb664782409edd93fd5d3ab85efec'] = 'Aktivera validering för momsnummer i adressavsnittet på Back-office.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_50da52ae50ce1c69d9ec84f9ae7de0e1'] = 'Vissa moduler använder styrenheter som tillhör back-office för att skapa kundadresser genom cron-uppgifter eller genom processer. För att modulen ska kunna validera momsnumren för dessa skapade adresser måste detta alternativ vara aktiverat.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_bb7bd05d489b31a0c31edfd4897745f4'] = 'Front office validering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_9176ffc4cac7d0b19daba445c764c2b1'] = 'Aktivera validering för momsnummer i adressdelen av Front-office när en kund skapar eller ändrar en adress eller under kassaprocessen.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_32b4427fd2b69a2c80d21c213e50f974'] = 'Länder för validering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_24110faeb01907815890b37ca9f60004'] = 'Välj länder för att aktivera valideringen. Du bör inte ändra denna lista om inte reglerna för verksamhet inom gemenskapen ändras och de inblandade länderna ändras eller om du vill inkludera ditt lokala land i valideringen.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_2d59f051b72e3fab1863a7720267abf8'] = 'CTRL och klicka eller klicka och dra för att välja flera alternativ.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_baf0132874563e2c6c272e59b29aa001'] = 'Inaktivera validering i moduler';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_545008be08be3bfd140b27aeeddbd682'] = 'Välj de tillgängliga modulerna för att inaktivera valideringen. I denna lista visas marknadsplatsmoduler installerade i din butik som utför import/synkronisering av kunder och beställningar. Dessa moduler hanterar kunddata och beställningar från sina plattformar, infogar dessa data direkt i databasen (skatter, orderbelopp), så för att upprätthålla integriteten för dessa data måste valideringen av data avaktiveras från modulen under synkroniseringen/ importprocessen. Om listan är tom betyder det att du inte har dessa moduler installerade.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_c9cc8cce247e49bae79f15173ce97354'] = 'Spara';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_55c643cac1d3ac86b2636b9d0f86211a'] = 'Tänk på att för att skattebefrielsen ska vara juridiskt korrekt måste handlaren, förutom kunden, vara registrerad med en giltig gemenskapsintern moms. Systemet kommer att validera handlarens gemenskapsinterna momsnummer av VIES innan det sparas i databasen.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_4c4974ffdbc418a104b9ac8fe50329f2'] = 'Handlarmoms';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_6c5e748d9e2d43bffbcf34fba6bf83c8'] = 'Ange handlarens momsnummer (med ISO-kod) som verksamheten är registrerad för inom gemenskapsverksamheten. Skriv fullständigt nummer med iso-kod (Ex: FR17852960). Momsnummer från Storbritannien är inte tillåtna.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_1709b640f134a404881e88edc01258bc'] = 'Detta är nödvändigt för alternativ för 2-vägs valideringssystem. Kan lämna tomt om du inte använder 2-vägs valideringssystem.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_d927b3b03a13bf31b7eb8f6ff92e07ca'] = 'Visa varningsmeddelande i adressen';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_8c0a80538a54ae2b99f5d930b34f65e2'] = 'Visar varningsmeddelanden i adressavsnittet på kundkontot när de inte har ett giltigt momsnummer registrerat, eller måste registrera ett momsnummer (obligatoriskt fältalternativ aktiverat) eller måste validera företagsfältet (företagsvalideringsalternativ aktiverat).';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_6bf5595b28f11a3701d3dc6c9d6e449d'] = 'Fungerar endast i Prestashop 1.7 eller högre';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_e119406d93b7385c70d4b607a81bcf32'] = 'Tillåt inte kassan när adressen är ofullständig';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_a2f3bd6da6361f19d81c48c65446422f'] = 'Det här alternativet tillåter inte kunden att fortsätta med köpprocessen om den valda adressen har fältet för momsnummer eller företagsnamn som måste valideras eller fyllas i (beroende på validerings- och momsfältets konfigurationsalternativ som valts). Användbart alternativ för kunder som redan hade registrerade adresser i databasen';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_d2afdcacd59b06e5541e4c32b24581b7'] = 'Anpassat prisblock';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_6607b1376017ff8c5845ae0e911f962b'] = 'Lägg till en anpassad text i produktprisblocket (under pris) så kommer den att visas när en kund har valt en adress med giltigt momsnummer och är skattebefriad.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_1b94355921381017449e017baaa43e5e'] = 'Det rekommenderas starkt att använda tvåvägsvalideringssystemet för att säkerställa den juridiska integriteten för skattebefrielsen vid transaktioner inom gemenskapen, verifiera både handlarens och kundens momsnummer. För tvåvägsvalidering är det nödvändigt att ställa in Merchants momsnummer i allmänna inställningar. Om alternativet Merchant moms är tomt kommer systemet att använda envägsvalidering i alla fall.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_8dd10878b69a18f881af0c0e36247cb0'] = 'Valideringssystem';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_24b0f41249450fb2b8d43025022f44a8'] = 'Välj valideringssystem för momsnummer. Validering 1-vägs kontrollerar och validerar endast kundens VAT-nummer, även när handlaren inte har ett giltigt VAT-nummer. Validering 2-way skickar information om handlarens VAT-nummer och kundens VAT-nummer och verifierar om båda redan är registrerade för att bedriva verksamhet inom gemenskap med skattebefrielse.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_6c106d4c676d2f70ee14fe9ac8b53a99'] = 'Fungerar endast med [Format + API system] valideringssystemalternativet valt.';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_147dc6e7f6af2b9b3bb0cf77bab90e41'] = 'Validering 1-vägs';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_4792ea7be8342c48e29cf2eeae895962'] = 'Validering 2-vägs';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_29dcf8f9e61af7c1f9e4bbd16cf4f2cf'] = 'Valideringsläge';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_c5a4695fbfd74fcfac2a3d505c66d43b'] = 'Detta alternativ ställer in läget för momsvalidering. Strikt läge validerar momsnummer med korrekt format infogat av kunden (ex: FR01609493). Smart läge validerar momsnummer även om formatet inte har infogats korrekt av kunden (ex.: FR-01609493, FR 01609493, FR01.609.493) och sparar som giltigt format (ex.: FR01609493)';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_006576df800107db40832e2e0fd44931'] = 'Strikt läge';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_dfea54ef85aa32f8489ae0f672d91c5a'] = 'Smart läge';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_94b93271d0dfce2b59ba77cc690415a3'] = 'Valideringstyp';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_99dd2d580dc5196d7e919645a054c28a'] = 'Detta alternativ ställer in typen av momsvalidering. Formatvalideringsläget validerar endast formatet för momsnummer (ex.: FR01609493). Format + API-validering validerar formatet för momsnummer och verifierar det i VIES eller GOV.UK API-system (rekommenderas för momsbefrielse).';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_5718f767fd5edcc521f57c23f4527725'] = 'Formatvalidering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_3b19c288b70dc9b277b83cb937d1df74'] = 'Format + API-systemvalidering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_54df18253716c9795f66ed2d4255833b'] = 'Företagsvalidering';
$_MODULE['<{advancedvatmanager}prestashop>advancedvatmanager_93370977d5f528ed94a8f7cf6e7156be'] = 'Om det är aktiverat kommer företagsnamnsfältet att valideras tillsammans med informationen som erhålls från VIES/GOV.UK-systemet angående VAT-numret. Om kunden inte skriver in företagsnamnet exakt som det visas i VIES/GOV.UK-systemets databas, kommer adressen inte att valideras med detta momsnummer. De tidigare kunderna registrerade i databasen med företagsnamn som inte är validerat ännu men giltig moms, de kommer att behöva uppdatera adressuppgifterna innan de gör ett köp i butiken.';
