$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_725c965b569cde8598c1a64b3ef35b73'] = 'Kunden som har ett giltigt momsnummer i sin adress kommer att tilldelas den valda gruppen beroende på adressland. Om klienten har flera adresser från olika länder kommer systemet att lägga till honom i så många grupper som det har konfigurerat efter länder.';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_34c58cceb7dfc65149c483c400538067'] = 'Alternativ [Use as default group] :';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_024eabed4f59a4927c8723fe0c914b70'] = 'Om det här alternativet är aktiverat, när kunden tilldelas en grupp beroende på landet för den skapade adressen, kommer denna grupp att bli standardgruppen för denna kund. Om kunden lägger till fler adresser från olika länder kommer standardgruppen att ändras till den grupp den lades till sist.';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_f600d68db7ba8913115bbd05608938ed'] = 'Alternativ [Change default group with address] :';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_28d911ad25619fb5f1d88754dba47ebd'] = 'Om det här alternativet är aktiverat, när kunden väljer en viss adress för att göra sin beställning i kassaprocessen, kommer kundens standardgrupp att ändras till den grupp som tillhör landet för den valda adressen.';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_cc85ffddd57f9ec398514aef1ff9f298'] = 'Alternativ [Remove customer from another groups] :';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_b6b4476becbf99ec2edffdb1d032898c'] = 'Om detta alternativ är aktiverat kommer kunden att tilldelas gruppen som valts av landet för den skapade adressen och tas bort från resten av grupperna som de tidigare tillhörde och den kommer att tilldelas denna grupp som standardgrupp. Det här alternativet är användbart när du vill att kunden endast ska tillhöra en grupp och inte till så många som adresser från olika länder har skapats på ditt konto.';
$_MODULE['<{advancedvatmanager}prestashop>groupassignment_description_205bb8060e975b0776bc4dac2a655092'] = 'När en kund tar bort en adress på sitt konto, om han tilldelades gruppen som konfigurerats för det landet och inte har fler adresser med samma land, kommer han att tas bort från den gruppen. Om den hade fler adresser med samma land skulle den fortfarande tilldelas den gruppen. Om kunden bara är tilldelad en grupp som tillhör det land där hans adress är och han tar bort adressen, kommer systemet att ta bort honom från den gruppen och för att undvika att bli lämnad utan att bli tilldelad någon grupp och därmed undvika en konflikt i databasdata , kommer systemet att omtilldela den till gruppen som är konfigurerad som standard i Prestashop för registrerade kunder.';
$_MODULE['<{advancedvatmanager}prestashop>faq_4ab310316fb4c1fe03d7dfdd06bf899d'] = 'När kunden redan har sparat en adress med ett giltigt momsnummer, måste han då validera adressen varje gång han gör en beställning?';
$_MODULE['<{advancedvatmanager}prestashop>faq_6bc9f601d4bd8ba5c5bdc320ef13ef1d'] = 'När en kund skapar en adress med ett giltigt VAT-nummer validerar systemet det och sparar valideringsresultatet i databasen, så när han använder samma adress för att lägga beställningar behöver han inte validera det igen.';
$_MODULE['<{advancedvatmanager}prestashop>faq_d9c773e5a7c093f70c15421ce0649efe'] = 'Om Cron-uppgiften för validering av momsnummer utförs och kundens momsnummer inte längre är giltigt, kommer systemet att upptäcka detta och det är då som kunden inte längre är momsbefriad förrän de infogar ett giltigt momsnummer igen i riktning.';
$_MODULE['<{advancedvatmanager}prestashop>faq_01b8106ef739e39e37ecd3b2aa59fbbf'] = 'Om butiken redan har kundadresser med momsnummer sparade innan modulinstallationen, Hur kan adresserna kontrolleras för att ta reda på om kunder har angett ett giltigt momsnummer eller inte?';
$_MODULE['<{advancedvatmanager}prestashop>faq_212d8a06c6b54e3da48e6012dc0a23ff'] = 'Modulen har en CRON-uppgiftsfunktion för att kontrollera VAT-numren på alla kundadresser som redan finns lagrade i databasen. När modulen är installerad i butiken kontrollerar systemet automatiskt momsnumren för kunder som skapar en adress eller ändrar den de redan har skapat.';
$_MODULE['<{advancedvatmanager}prestashop>faq_1a0ea82254a62da89cadd91ba343b23c'] = 'När jag kör CRON-uppgiften för att kontrollera kundens momsnummer, kontrollerar processen alla adresser i databasen igen?';
$_MODULE['<{advancedvatmanager}prestashop>faq_7a2204718dfcecae6301eabebc53f85a'] = 'Systemet kommer att kontrollera alla kundadresser som är lagrade i databasen om inte alternativet \"Fortsätt skanningsprocessen från senast skannade adress\" är aktiverat i avsnittet CRON-inställningar.';
$_MODULE['<{advancedvatmanager}prestashop>faq_501f1eb5ae111aa3695da583b05d8344'] = 'Jag använder en Marketplaces-modul som importerar kunddata och beställningar som genereras på plattformen. Den här plattformen kontrollerar dock priserna och skattefördelningen för dessa beställningar. Hur kan jag konfigurera modulen så att den inte försöker validera momsnumren för importerade kunddata av marknadsplatsmodulen och låter marknadsplatsen hantera skatter och priser för de beställningar som importeras?';
$_MODULE['<{advancedvatmanager}prestashop>faq_18cb4a292d3b58537a59ca2156a87f8a'] = 'För att inaktivera valideringen av kundmomsnummer som importeras från dessa moduler för att synkronisera data med marknadsplatser, måste du inaktivera alternativet \"Back-office-validering\" i avsnittet \"Aktivering\" på konfigurationssidan för denna modul. Observera att beroende på vilken typ av exekvering av dataimporten för dessa marknadsplatsmoduler kanske det inte räcker att inaktivera det här alternativet.';
$_MODULE['<{advancedvatmanager}prestashop>brexit_description_8137db6ff17c5e78f769e8d116c634fe'] = 'Om Brexit-alternativet är aktiverat kommer systemet att beräkna varukorgens totala produktbelopp och om det är lika med eller under %s (motsvarande 135 GBP) för att hantera skatterna beror på varje situation. Det här alternativet möjliggör validering av UK VAT-nummer med hjälp av GOV.UK-systemets API så länge som system-API-valideringen är vald.';
$_MODULE['<{advancedvatmanager}prestashop>brexit_description_5af404f31fadca9508383fc002a20fd6'] = 'Detta system är uppdaterat till den nya Brexit-lagstiftningen. Skattekontrollen fungerar enligt följande:';
$_MODULE['<{advancedvatmanager}prestashop>brexit_description_0b83795dbb237b656e41ea8475c2d5f0'] = 'Varukorgsbelopp lika med eller mindre än 135GBP (exklusive frakt)';
