$_MODULE['<{advancedvatmanager}prestashop>brexit_description_016a392e7c93b7a65e77f8adbe3f3f37'] = 'Om du har alternativet \"Momsbefrielse i företag\" aktiverat, kommer butiken inte att ta ut skatt och fakturan kommer att innehålla meddelandet \"omvänd skattskyldighet: kund ska redovisa moms till HMRC\". Om alternativet är inaktiverat kommer det också att ta ut skatter.';
