$_MODULE['<{advancedvatmanager}prestashop>troubleshooting_1d27f6d58f654c4bf9fa41911fe6132f'] = 'Detta är ett problem som orsakas av webbplatsens cache. Det händer oftare om du har Prestashop-cachen aktiverad och alternativet [Never collect template files] i smarty-sektionen. För att lösa det måste Prestashop-cachen rengöras. Det rekommenderas att utföra en periodisk rengöring av Prestashop-cachen med hjälp av CRON-uppgifter.';
$_MODULE['<{advancedvatmanager}prestashop>troubleshooting_b291349c054acc854f559379a92c04fc'] = 'Modulen försöker validera momsnummer för kunder som bor i det land där butiken är belägen.';
$_MODULE['<{advancedvatmanager}prestashop>troubleshooting_3b2a3cc4bbf0d7aedd8cfe1bb52d64b6'] = 'Kontrollera att i alternativet \"Länder för validering\" i avsnittet \"aktivering\" är det lokala landet för butiken inte valt.';
$_MODULE['<{advancedvatmanager}prestashop>configure_3f48c57b41a8fd83b522cb0beb195823'] = 'Advanced VAT Manager - Översikt';
$_MODULE['<{advancedvatmanager}prestashop>configure_742a785838ef383d368f8121bca58ac0'] = 'Kontrollera giltigheten av momsnumren för de kunder som registrerar sig i butiken. Hantera kunder med momsnummer och koppla dem till kundgrupper automatiskt. Ta bort skatter i produktpriser, hantera Brexit- och VOEC-skattebestämmelser och många fler alternativ.';
$_MODULE['<{advancedvatmanager}prestashop>configure_b39bceeded94d6ced6100f53fa488e85'] = 'Denna modul har flera alternativ och avancerade funktioner. Du måste läsa moduldokumentationen noggrant för att förstå hur det fungerar i allmänhet och med vart och ett av alternativen. Du kan komma åt dokumentationen från samma konfigurationssida genom att gå in på fliken [Documentation] .';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_99a2ba942e5cc13152c6f952af1df179'] = 'VOEC-systemet (VAT On Ecommerce) är ett skattesystem skapat av den norska regeringen utformat för företag som bor utanför norskt territorium och säljer produkter till konsumenter som bor i Norge. Om den totala beräkningen av försäljningsbeloppet under 12 månader överstiger %s (50 000 NOK) tröskeln, måste du registrera dig i VOEC-systemet för att samla in moms direkt från försäljningsstället (nätbutiken) när en kund köper en produkt vars värde är mindre än %s (3 000 NOK). Om du inte överskrider den årliga försäljningströskeln på %s men ändå uppfyller kraven för att registrera dig med VOEC-systemet måste du göra det.';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_3e4e4760030acbcb7ddc9a795b2d2d93'] = 'Du kan hitta mer information på den officiella webbplatsen för den norska skattemyndigheten på följande länk:';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_e9d11931414b6608c1eaa503fe7dcd75'] = 'Norska Skatteverkets hemsida';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_548d39daee658c5ad2adec8248fb449d'] = 'VOEC-läge';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_f0a0831b85efe77849628f3597516fee'] = 'Standardläge:';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_2d0394284c320792333c6f19d511386b'] = 'Det tillåter inte kombinerade köp av produkter som faller inom VOEC-systemet (belopp mindre än 3 000 NOK) med produkter som ligger utanför VOEC-systemet (belopp större än 3 000 NOK eller exceptionella produkter). Kunderna kommer inte att kunna göra köpet förrän de har eliminerat den/de produkter som skiljer sig från resten i varukorgen.';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_2cd0d6b0508d649c9fe2436b957ec45f'] = 'Buntningsläge:';
$_MODULE['<{advancedvatmanager}prestashop>voec_description_83c84db7af36602934a9ac52da70f8a3'] = 'Det tillåter kunder att göra kombinerade inköp inom samma paket av produkter som ingår i VOEC-systemet och de som inte ingår. I detta fall kommer försäljningen att göras momsfri vid försäljningsstället och kunden måste betala moms när paketet når gränsen.';
