$_MODULE['<{advancedvatmanager}prestashop>checkvatcron_f839e61e09022306906a5b72bde401e1'] = 'Denna CRON-uppgift är att kontrollera alla kundadresser för att validera VAT-numret. Systemet kommer endast att analysera adresserna till de klienter som uppfyller villkoren som konfigurerats på konfigurationssidan för denna modul. Regelbundet utförande av detta cron-jobb skyddar leverantören från inköp med skatteansökningsfel när kundens momsnummer tidigare var giltigt och nu inte längre är giltigt.';
$_MODULE['<{advancedvatmanager}prestashop>checkvatcron_5e83dd1817e12d6ceb3c68b1259b859b'] = 'Du bör konfigurera en CRON-uppgift i din serverpanel (fråga till din värdserverleverantör) eller i Prestashop-modulen \"Cron task manager\". Du bör konfigurera frekvensen för att utföra denna CRON-uppgift. CRON-uppgiften kommer att utföras beror på alternativen aktiverade nedan.';
