$_MODULE['<{advancedvatmanager}prestashop>orders_importation_d13041e5eca5840edec8b2d9152bff8d'] = 'Detta verktyg importerar beställningar som inte har sparats i det här avsnittet ännu. Detta verktyg är mycket användbart för att spara beställningar när modulen inte var installerad. När modulen är installerad kommer de beställningar som uppfyller kraven (VOEC-kund eller Brexit beror på om dessa alternativ är aktiverade från modulkonfigurationssidan) att sparas i det här avsnittet. I vilket fall som helst kommer beställningar relaterade till verksamhet inom gemenskapen att importeras.';
