$_MODULE['<{advancedvatmanager}prestashop>form_28371256b723459e31636eda1c651af6'] = 'OBS: Att de är kompatibla garanterar inte att det kan finnas en möjlighet att vissa alternativ i vår modul inte fungerar när några av dessa moduler aktiveras i butiken. Kompatibilitet säkerställer att både installerade och fungerande moduler kan samexistera utan att generera fel eller konflikter mellan dem. Endast i de moduler som är helt integrerade fungerar funktionaliteterna och alla tillval i vår modul korrekt och är perfekt integrerade i dessa moduler. Vi rekommenderar att du skaffar de moduler som vi har utvecklat integrationen till och som finns i integrationslistan';
