$_MODULE['<{advancedvatmanager}prestashop>form_f5596427a7186c3c13aabdc64b7cacc5'] = 'Den här modulen är utformad för att göra de nödvändiga ändringarna i åsidosättningsfilerna för att säkerställa kompatibilitet mellan de listade modulerna när den väl har installerats, omstartats eller aktiverats. Du behöver inte göra någon åtgärd från din sida, hela processen görs automatiskt. När vår modul avaktiveras eller avinstalleras, returnerar modulsystemet den ursprungliga koden för åsidosättningarna av de kompatibla modulerna som aktiveras i det ögonblicket.';
$_MODULE['<{advancedvatmanager}prestashop>form_16d06b3f6ba6c0f780a6a587987accf4'] = 'Om du har några problem med kod för åsidosättande av metoder som har anpassats tidigare. Modulen, varje gång den installeras eller aktiveras, sparar en säkerhetskopia av allt innehåll i mappen [override] i butikens rotkatalog till mappen [backup] i modulkatalogen.';
$_MODULE['<{advancedvatmanager}prestashop>form_74a1f4e0259f786597fbe6f48e45a20b'] = 'Procedur vid installation eller aktivering av någon av modulerna som anges i denna kompatibilitets- och integrationslista';
$_MODULE['<{advancedvatmanager}prestashop>form_b94f6bb65017cec7bc1e733b8282f826'] = 'Om du redan har vår modul installerad och du vill installera någon av modulerna som anges i denna kompatibilitets- och integrationslista, behöver du bara avaktivera vår modul, installera önskad modul och slutligen aktivera vår modul igen. Genom att aktivera vår modul kommer systemet att utföra kompatibilitet vid åsidosättningar.';
